class Solution {
public:
    int minOperations(vector<int>& nums) {
        int n = nums.size();
        int ans = 0;
        bool flip = false; 

        for (int i = 0; i < n; i++) {
            if ((nums[i] + flip) % 2 == 0) {
                ans++; 
                flip = !flip;  
            }
        }

        return ans;
    }
};

